import React, { Component } from "react";
import c from "../notes/c3/c.wav";
import d from "../notes/c3/d.wav";
import e from "../notes/c3/e.wav";
import f from "../notes/c3/f.wav";
import g from "../notes/c3/g.wav";
import a from "../notes/c3/a.wav";
import b from "../notes/c3/b.wav";

class GuessTheNote extends Component {
  render() {
    const playSound = (note) => {
      const audio = new Audio(note);
      audio.play();
    };

    return (
      <div className="guessTheNote">
        <button onClick={() => playSound(c)}> C </button>
        <button onClick={() => playSound(d)}> D </button>
        <button onClick={() => playSound(e)}> E </button>
        <button onClick={() => playSound(f)}> F </button>
        <button onClick={() => playSound(g)}> G </button>
        <button onClick={() => playSound(a)}> A </button>
        <button onClick={() => playSound(b)}> B </button>
      </div>
    );
  }
}

export default GuessTheNote;
